import React from 'react';
import './Multiplier.css';

const Multiplier = ({ multiplier, index, onHit }) => {
  const handleHit = () => {
    onHit();
  };

  return (
    <div
      className="multiplier"
      style={{ left: index * 50 + 20 }}
      onClick={handleHit}
    >
      x{multiplier}
    </div>
  );
};

export default Multiplier;
